import React from 'react';
import {
  Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
  FormControl, InputLabel, Select, MenuItem, Box, Button, TextField,
  IconButton, TableSortLabel, TablePagination, Chip, Typography
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { useAuth } from '../contexts/AuthContext';
import { getAllReports } from '../services/api';
import ReportDetailModal from './ReportDetailModal';
import EditReportModal from './EditReportModal'; // Import the new modal
import { deleteReport, updateReport } from '../services/api'; // Import api functions
import { useState } from 'react';

const statusOptions = ['Submitted', 'Reviewed', 'Rejected'];
const nameOptions = ['Alice', 'Bob', 'Charlie'];
const dateOptions = ['2024-06-01', '2024-06-02', '2024-06-03'];

function getEmployeeName(r) {
  const user = r.User || r.user;
  if (!user) return 'N/A';
  if (user.firstName && user.lastName) return `${user.firstName} ${user.lastName}`;
  if (user.dataValues && user.dataValues.firstName && user.dataValues.lastName)
    return `${user.dataValues.firstName} ${user.dataValues.lastName}`;
  // Log the user object for further debugging
  console.log('User object:', user);
  return 'N/A';
}

export default function ReportsTable({
  reports,
  filters,
  setFilters,
  fetchReports,
  sorting,
  setSorting,
  page,
  setPage,
  rowsPerPage,
  totalReports,
  isMyReportsView,
}) {
  const { user } = useAuth();
  const [selectedReport, setSelectedReport] = useState(null);
  const [editingReport, setEditingReport] = useState(null); // State for edit modal

  React.useEffect(() => {
    // Only managers can filter all reports via this component
    if (user && user.role === 'manager') {
      getAllReports(filters).then(setReports);
    }
  }, [filters, user, setReports]);

  const handleChange = (e) => {
    setFilters(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };
  
  const handleViewClick = (report) => {
    setSelectedReport(report);
  };

  const handleCloseModal = () => {
    setSelectedReport(null);
  };
  
  const handleDelete = async (reportId) => {
    if (window.confirm('Are you sure you want to delete this report?')) {
      try {
        await deleteReport(reportId);
        fetchReports(); // Refresh the list
      } catch (error) {
        console.error('Failed to delete report:', error);
        alert('Could not delete the report.');
      }
    }
  };
  
  const handleUpdate = async (reportId, newNotes) => {
    try {
      await updateReport(reportId, newNotes);
      setEditingReport(null); // Close modal on success
      fetchReports(); // Refresh the list
    } catch (error) {
      console.error('Failed to update report:', error);
      alert('Could not update the report.');
    }
  };

  const handleSortRequest = (property) => {
    const isAsc = sorting.field === property && sorting.direction === 'asc';
    setSorting({ field: property, direction: isAsc ? 'desc' : 'asc' });
  };

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const isActionable = (report) => {
    if (!user) return false;
    return user.id === report.userId || user.role === 'manager';
  };
  
  return (
    <Paper sx={{ mt: 3, overflow: 'hidden' }}>
      <Box sx={{ p: 2, borderBottom: '1px solid #ddd' }}>
        <Typography variant="h6" component="div">
          {isMyReportsView ? 'My Reports' : 'Reports'}
        </Typography>
      </Box>
      {user.role === 'manager' && !isMyReportsView && (
        <Box sx={{ p: 2, display: 'flex', gap: 2, alignItems: 'center' }}>
          <TextField
            label="Filter by Date"
            name="date"
            type="date"
            value={filters.date}
            onChange={handleChange}
            InputLabelProps={{ shrink: true }}
            sx={{ maxWidth: 180 }}
          />
          <FormControl sx={{ minWidth: 150 }}>
            <InputLabel>Status</InputLabel>
            <Select
              name="status"
              value={filters.status}
              label="Status"
              onChange={handleChange}
            >
              <MenuItem value=""><em>All Statuses</em></MenuItem>
              {statusOptions.map((s) => (
                <MenuItem key={s} value={s}>{s}</MenuItem>
              ))}
            </Select>
          </FormControl>
        </Box>
      )}
      <TableContainer>
        <Table stickyHeader>
          <TableHead>
            <TableRow>
              {!isMyReportsView && (
                <TableCell sortDirection={sorting.field === 'employee' ? sorting.direction : false}>
                  <TableSortLabel
                    active={sorting.field === 'employee'}
                    direction={sorting.direction}
                    onClick={() => handleSortRequest('employee')}
                  >
                    Employee
                  </TableSortLabel>
                </TableCell>
              )}
              <TableCell sortDirection={sorting.field === 'createdAt' ? sorting.direction : false}>
                <TableSortLabel
                  active={sorting.field === 'createdAt'}
                  direction={sorting.field === 'createdAt' ? sorting.direction : 'asc'}
                  onClick={() => handleSortRequest('createdAt')}
                >
                  Date
                </TableSortLabel>
              </TableCell>
              <TableCell sortDirection={sorting.field === 'status' ? sorting.direction : false}>
                <TableSortLabel
                  active={sorting.field === 'status'}
                  direction={sorting.field === 'status' ? sorting.direction : 'asc'}
                  onClick={() => handleSortRequest('status')}
                >
                  Status
                </TableSortLabel>
              </TableCell>
              <TableCell>View</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {reports.length === 0 ? (
              <TableRow>
                <TableCell colSpan={isMyReportsView ? 4 : 5} align="center">
                  No reports found.
                </TableCell>
              </TableRow>
            ) : (
              reports.map((r) => (
                <TableRow hover key={r.id}>
                  {!isMyReportsView && (
                    <TableCell>{getEmployeeName(r.User || r.user)}</TableCell>
                  )}
                  <TableCell>
                    {r.createdAt
                      ? new Date(r.createdAt).toLocaleString('tr-TR')
                      : r.date}
                  </TableCell>
                  <TableCell>
                    <Chip label={r.status || 'Submitted'} size="small" />
                  </TableCell>
                  <TableCell>
                    <Button onClick={() => handleViewClick(r)}>View</Button>
                  </TableCell>
                  <TableCell>
                    {isActionable(r) && (
                      <>
                        <IconButton onClick={() => setEditingReport(r)}><EditIcon /></IconButton>
                        <IconButton onClick={() => handleDelete(r.id)}><DeleteIcon /></IconButton>
                      </>
                    )}
                  </TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10]}
        component="div"
        count={totalReports}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
      />
      {selectedReport && (
        <ReportDetailModal
          report={selectedReport}
          onClose={handleCloseModal}
        />
      )}
      <EditReportModal
        report={editingReport}
        onClose={() => setEditingReport(null)}
        onSave={handleUpdate}
      />
    </Paper>
  );
}
